import {Injectable} from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class DataService {
  public undeadTransactions: Array<object> = [
    {type: 'paid', description: 'test 01'},
    {type: 'paid', description: 'test 01'},
    {type: 'paid', description: 'test 01'},
    {type: 'no paid', description: 'test 01'},
    {type: 'paid', description: 'test 01'}];

  constructor() {
  }
}
